import React from 'react';

import {Card} from '../card/card.component';


export const CardList =(props) => {
    return(
        <div >
        {/* <Paper elevation={3} >{props.children}</Paper> */}

      {props.monsters.map((monster) => (<Card key= {monster.id} monster = { monster} />))} 

    
        </div>);
}
